Here is a simple example of how you can create a tooltip in NextJS using React Context:

**Step 1: Create a Context**

Create a new file called `TooltipContext.js`:
```jsx
import { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
```
**Step 2: Create the Tooltip Component**

Create a new file called `Tooltip.js`:
```jsx
import { useContext } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useContext(TooltipContext);

  const handleMouseOver = () => {
    openTooltip(id);
  };

  const handleMouseOut = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseOver={handleMouseOver}
      onMouseOut={handleMouseOut}
      className={`tooltip ${activeTooltip === id ? 'active' : ''}`}
    >
      {children}
    </div>
  );
};

export default Tooltip;
```
**Step 3: Wrap your App with the TooltipProvider**

In your `pages/_app.js` file, wrap your app with the `TooltipProvider`:
```jsx
import { TooltipProvider } from '../components/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```
**Step 4: Use the Tooltip Component**

Now you can use the `Tooltip` component anywhere in your app:
```jsx
import Tooltip from '../components/Tooltip';

const MyComponent = () => {
  return (
    <div>
      <Tooltip id="tooltip-1">
        <span>Hover me!</span>
        <div className="tooltip-content">This is the tooltip content!</div>
      </Tooltip>
    </div>
  );
};
```
In this example, when you hover over the `span` element, the tooltip with the id `tooltip-1` will be opened. If you hover over another `Tooltip` component with a different id, the previously opened tooltip will be closed.

