Static variables are variables that are allocated storage only once at compile time, and they retain their values between different function calls. They are initialized only once at compile time. Static variables can be either internal or external. Internal static variables are known only within the file where they are declared, while external static variables are known by all the files in the program.
Register variables are variables that the programmer suggests should be stored in one of the machine's registers, rather than in random-access memory (RAM). The register keyword is used to declare a register variable. The compiler may ignore this suggestion, but it will not prevent the program from compiling or executing correctly.
Here is an example of static and register variables in C:
```
#include <stdio.h>

void func() {
    static int x = 10;  // static variable
    register int y = 20;  // register variable

    printf("x = %d, y = %d\n", x, y);
    x++;
    y++;
}

int main() {
    func();
    func();
    return 0;
}
```
In this example, the variable `x` is a static variable, so it retains its value between function calls. The variable `y` is a register variable, which means that the compiler may store it in a register for faster access.

Note that the `register` keyword is only a suggestion to the compiler, and it may not actually store the variable in a register. The `static` keyword, on the other hand, has a specific meaning and is always enforced by the compiler.

