Here is a simple example of how you can achieve this in JavaScript:
```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length);
  const view = new DataView(buffer);
  let offset = 0;
  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id;
    const size = entity.size;
    const packed = (id << 3) | size;
    view.setUint8(offset, packed);
    offset++;
  }
  return buffer;
}

function unpackEntities(buffer) {
  const view = new DataView(buffer);
  const entities = [];
  for (let i = 0; i < buffer.byteLength; i++) {
    const packed = view.getUint8(i);
    const id = packed >> 3;
    const size = packed & 0x7;
    entities.push({ id, size });
  }
  return entities;
}
```
