*   The `packEntities` function takes an array of entities and packs them into an ArrayBuffer. It uses a DataView to write the packed entities to the buffer.
*   The `unpackEntities` function takes an ArrayBuffer and unpacks the entities from it. It uses a DataView to read the packed entities from the buffer.

